CREATE DATABASE vendasFeliz;

USE vendasFeliz;

CREATE TABLE Fornecedores (
  cnpj VARCHAR(20)  NOT NULL   ,
  razaoSocial VARCHAR(35)  NOT NULL  ,
  nomeFantasia VARCHAR(20)  NULL  ,
  categoria VARCHAR(35)  NULL  ,
  telefone VARCHAR(18)  NULL  ,
  email VARCHAR(45)  NULL  ,
  endereco VARCHAR(30)  NULL  ,
  numero VARCHAR(10)  NULL  ,
  cep VARCHAR(12)  NULL  ,
  cidade VARCHAR(30)  NULL  ,
  estado VARCHAR(30) NULL    ,
PRIMARY KEY(cnpj));


CREATE TABLE Transportadoras (
  cnpj VARCHAR(20)  NOT NULL   ,
  nome VARCHAR(30) NULL , 
  email VARCHAR(45)  NULL  ,
  telefone VARCHAR(18)  NULL  ,
  tipoDeEntrega VARCHAR(20) NULL,
PRIMARY KEY(cnpj));

CREATE TABLE Produtos (
  idProduto INTEGER UNSIGNED  NOT NULL   AUTO_INCREMENT,
  nome VARCHAR(60) NOT NULL,
  qtdEstoque INT  NULL  ,
  detalheProduto TEXT  NULL    ,
PRIMARY KEY(idProduto));

CREATE TABLE Pedidos (
  idPedidos INTEGER UNSIGNED  NOT NULL   ,
  Produtos_idProduto INTEGER UNSIGNED  NOT NULL  ,
  dataPedido DATETIME  NULL  ,
  enderecoEntrega VARCHAR(30)  NULL  ,
  valorTotal DECIMAL(10,2)  NULL  ,
  desconto DECIMAL(10,2) NULL,
  valorTotalComDesconto DECIMAL(10,2)  NULL  ,
  statusPedido VARCHAR(12) NULL,
PRIMARY KEY(idPedidos),
foreign key(Produtos_idProduto) 
REFERENCES Produtos(idProduto));


CREATE TABLE Clientes (
  idCliente INTEGER UNSIGNED  NOT NULL   AUTO_INCREMENT,
  nome VARCHAR(15)  NULL  ,
  sobrenome VARCHAR(25)  NULL  ,
  email VARCHAR(45)  NULL  ,
  genero VARCHAR(1)  NULL  ,
  telefone VARCHAR(18)  NULL  ,
  endereco VARCHAR(30)  NULL  ,
  numero VARCHAR(10)  NULL  ,
  complemento VARCHAR(12)  NULL  ,
  cep VARCHAR(12)  NULL  ,
  cidade VARCHAR(30)  NULL  ,
  estado VARCHAR(30)  NULL    ,
  zona varchar(10) NULL,
  dataDoCadastro DATETIME NULL,
PRIMARY KEY(idCliente));


CREATE TABLE Garantia (
  id INTEGER UNSIGNED  NOT NULL   AUTO_INCREMENT,
  fornecedores_cnpj VARCHAR(20)  NOT NULL  ,
  inicio DATETIME  NULL  ,
  final DATETIME  NULL  ,
  condicoes TEXT  NULL    ,
PRIMARY KEY(id),
  FOREIGN KEY(fornecedores_cnpj)
    REFERENCES Fornecedores(cnpj));
    

CREATE TABLE Sessao (
id INTEGER UNSIGNED  NOT NULL   AUTO_INCREMENT,
  Clientes_idCliente INTEGER UNSIGNED  NOT NULL  ,
  dispositivoUsado VARCHAR(10)  NULL  ,
  inicioSessao DATETIME null,
  PRIMARY KEY(id),
  FOREIGN KEY(Clientes_idCliente)
    REFERENCES Clientes(idCliente));
    
    
CREATE TABLE Entregas (
  idEntregas INTEGER UNSIGNED  NOT NULL   AUTO_INCREMENT,
  Transportadoras_cnpj VARCHAR(20)  NOT NULL  ,
  numeroRastreio VARCHAR(20)  NULL  ,
  frete DECIMAL(10,2)  NULL    ,
PRIMARY KEY(idEntregas),
  FOREIGN KEY(Transportadoras_cnpj)
    REFERENCES Transportadoras(cnpj));

CREATE TABLE Avaliacoes (
  Clientes_idCliente INTEGER UNSIGNED  NOT NULL ,
  comentario TEXT  NULL  ,
  estrelas INT  NULL  ,
  FOREIGN KEY(Clientes_idCliente)
    REFERENCES Clientes(idCliente));
    

    
CREATE TABLE EstoqueFornecedor (
  Fornecedores_cnpj VARCHAR(20)  NOT NULL  ,
  Produtos_idProduto INTEGER UNSIGNED  NOT NULL    ,
  FOREIGN KEY(Fornecedores_cnpj)
    REFERENCES Fornecedores(cnpj),
  FOREIGN KEY(Produtos_idProduto)
    REFERENCES Produtos(idProduto));
    
    
    

CREATE TABLE DadosPedidos (
  Clientes_idCliente INTEGER UNSIGNED  NOT NULL  ,
  Pedidos_idPedidos INTEGER UNSIGNED  NOT NULL    ,
PRIMARY KEY(Clientes_idCliente, Pedidos_idPedidos),
  FOREIGN KEY(Clientes_idCliente)
    REFERENCES Clientes(idCliente),
  FOREIGN KEY(Pedidos_idPedidos)
    REFERENCES Pedidos(idPedidos));


CREATE TABLE EntregaReversa (
  idEntregaReversa INTEGER UNSIGNED  NOT NULL  ,
  Transportadora_cnpj VARCHAR(20)    ,
PRIMARY KEY(idEntregaReversa),
  FOREIGN KEY(Transportadora_cnpj)
    REFERENCES Transportadoras(cnpj));
    
  
    
CREATE TABLE NotaFiscal (
  idNotaFiscal INTEGER UNSIGNED  NOT NULL,
  dataNota datetime,
  valorNota decimal(10,2),
PRIMARY KEY(idNotaFiscal));

CREATE TABLE FormasPagamentos (
  id INTEGER UNSIGNED  NOT NULL   AUTO_INCREMENT,
	pix VARCHAR(10),
	ted VARCHAR(10),
  numeroCartao VARCHAR(20)  NULL  ,
  dataVencimento DATE  NULL  ,
  nomeTitular VARCHAR(20)  NULL  ,
  codigoSeguranca VARCHAR(3)  NULL  ,
  qtdDeParcelas INT  NULL  ,
  juros decimal(10,2)  NULL  ,
  bancoEmissor INT  NULL    ,
  valorParcela numeric(10,2),
PRIMARY KEY(id));


CREATE TABLE Pagamentos (
  id INTEGER UNSIGNED  NOT NULL   AUTO_INCREMENT,
  Pedidos_idPedidos INTEGER UNSIGNED  NOT NULL   ,
  Entregas_idEntregas INTEGER UNSIGNED  NOT NULL   ,
  NotaFiscal_idNotaFiscal INTEGER UNSIGNED  NOT NULL   ,
  FormasPagamentos_id INTEGER UNSIGNED  NOT NULL   ,
  valorPago DECIMAL(10,2)  NULL  ,
  dataPagto DATETIME  NULL  ,
PRIMARY KEY(id),
  FOREIGN KEY(Pedidos_idPedidos)
    REFERENCES Pedidos(idPedidos),
    FOREIGN KEY(Entregas_idEntregas)
		REFERENCES Entregas(idEntregas),
    FOREIGN KEY(NotaFiscal_idNotaFiscal)
		REFERENCES NotaFiscal(idNotaFiscal),
    FOREIGN KEY(FormasPagamentos_id)
		REFERENCES FormasPagamentos(id));


CREATE TABLE ConsolidaNegocio (
  idConsolidaNegocio INTEGER UNSIGNED  NOT NULL   AUTO_INCREMENT,
  EntregaReversa_idEntregaReversa INTEGER UNSIGNED  NOT NULL   ,
  FormasPagamentos_id INTEGER UNSIGNED  NOT NULL   ,
  Pedidos_idPedidos INTEGER UNSIGNED  NOT NULL   ,
PRIMARY KEY(idConsolidaNegocio),
    FOREIGN KEY(EntregaReversa_idEntregaReversa)
		REFERENCES EntregaReversa(idEntregaReversa),
    FOREIGN KEY(FormasPagamentos_id)
		REFERENCES FormasPagamentos(id),
        FOREIGN KEY(Pedidos_idPedidos)
		REFERENCES Pedidos(idPedidos));
        
       
        



	




















